encode_msg_list_value(#{} = M, Bin, TrUserData) ->
    case M of
        #{values := F1} ->
            TrF1 = id(F1, TrUserData),
            if TrF1 == [] -> Bin;
               true -> e_field_list_value_values(TrF1, Bin, TrUserData)
            end;
        _ -> Bin
    end.

encode_msg_timestamp(Msg, TrUserData) ->
