decode_msg_timestamp_offset(Bin, TrUserData) ->
    dfp_read_field_def_timestamp_offset(Bin,
                                        0,
                                        0,
                                        id(0, TrUserData),
                                        id(false, TrUserData),
                                        TrUserData).

dfp_read_field_def_timestamp_offset(<<8, Rest/binary>>,
                                    Z1, Z2, F@_1, F@_2, TrUserData) ->
    d_field_timestamp_offset_timestampInMs(Rest,
                                           Z1,
                                           Z2,
                                           F@_1,
                                           F@_2,
                                           TrUserData);
dfp_read_field_def_timestamp_offset(<<16, Rest/binary>>,
                                    Z1, Z2, F@_1, F@_2, TrUserData) ->
    d_field_timestamp_offset_strictAccuracy(Rest,
                                            Z1,
                                            Z2,
                                            F@_1,
                                            F@_2,
