        {id('d_enum_hstream.server.SpecialOffset'(begin
                                                      <<Res:32/signed-native>> =
                                                          <<(X bsl N +
                                                                 Acc):32/unsigned-native>>,
                                                      id(Res, TrUserData)
                                                  end),
            TrUserData),
         Rest},
    dfp_read_field_def_stream_offset(RestF,
                                     0,
                                     0,
