    'dfp_read_field_def_map<string,value>'(Rest2,
                                           0,
                                           0,
                                           F@_1,
                                           F@_2,
                                           TrUserData).

'skip_group_map<string,value>'(Bin, FNum, Z2, F@_1,
                               F@_2, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    'dfp_read_field_def_map<string,value>'(Rest,
                                           0,
